import './App.css';

import { useEffect, useState } from "react"

export default function ParkingList() {

    let availableParkingId = [], availableParkingCarTypeVar = []
    let fetched = []

    let carType = []
    const endPoint = "https://api.data.gov.hk/v1/carpark-info-vacancy"
    const load = () => {

        fetch(endPoint + "?data=vacancy")
            .then(response => response.json())
            .then(fetchedResult => {
                fetched = fetchedResult.results;
                fetched.map((parking => {

                    if (parking.privateCar !== undefined && parking.privateCar[0].vacancy > 0) {
                        carType.push("Private Car, ")
                    }
